create database reto_empleados;
use reto_empleados;

create table empleados (
	id_empleado VARCHAR(50),
	nombre VARCHAR(50),
	edad  INT,
	salario DECIMAL(7,2),
	fecha_contrato DATE,
	departamento VARCHAR(50)
);


#1. lista de empleados
select nombre, edad, salario from empleados;

#2. altos ingresos
select nombre, salario from empleados where salario > 4000;

#3.fuerza de ventas
select nombre, departamento from empleados where departamento = "Sales";

#4.rango de edad
select nombre, edad from empleados where edad between 30 and 40;

#5.nuevas contrataciones
select nombre, fecha_contrato from empleados where year(fecha_contrato) > 2020;

#6.distribucion de empleados
select departamento, count(*) as num_empleados from empleados group by departamento;

#7.analisis salarial
select avg(salario) as promedio_salario from empleados;

#8.nombres selectivos
select nombre from empleados where left(nombre, 1) in ('A', 'C');

#9.Departamentos especificos
select nombre, departamento from empleados where departamento != "IT";

#10. mejor pagado
select nombre, salario from empleados where salario = max(salario);
select * from empleados order by salario;